Ce qu’il convient de dire ou de faire dans une société ; savoir-vivre.<br />
Pour nous ce qu’il convient de faire dans la société, c’est d’être conscient et de tenter de réduire son impact social et environnemental, plus particulièrement en ce qui a trait à l’industrie de la mode. Nous n’avons pas la prétention d’être parfaits, mais voulons offrir au consommateur une transparence et les informations nécessaires pour l’aider à faire des choix en accord avec ses convictions.<br />
